import React from 'react';
import './Footer.css';

function Footer() {

   const footerDetailOpen = '/*';
   const footerDetailClose = '*/';

   return (

      <footer>

         <ul className="footer-contact">

            <li className="nav-item">{footerDetailOpen}</li>
            <li className="nav-item"><a href="sms:+14257365875">425.736.5875</a></li>
            <li className="nav-item"><a href="mailto:contact.eliwood@gmail.com">contact.eliwood@gmail.com</a></li>
            <li className="nav-item"><a href="https://www.linkedin.com/in/eliwoodprofessional/" target="_blank" rel="noreferrer">LinkedIn</a></li>
            <li className="nav-item"><a href="https://github.com/MrEliWood" target="_blank" rel="noreferrer">GitHub</a></li>
            <li className="nav-item">{footerDetailClose}</li>

         </ul>

      </footer>

   );

}

export default Footer;
